		public static IList<IList<int>> ThreeSum(int[] nums)
		{
			List<IList<int>> triplets = new List<IList<int>>();
			List<(int, int, int)> tripletsTuples = new List<(int, int, int)>();

			if (nums.Length < 3)
				return triplets;
			//else if(nums.Length == 3)
			//{
			//	triplets.Add(new List<int>(nums));
			//	return triplets;
			//}
			

			for(int i = 0; i < nums.Length; i++)
			{

				LinkedList<int[]> pairs = TwoSum(nums, -1 * nums[i], i);
				//int[] pair = TwoSum(nums, -1 * nums[i], i);
				foreach(int[] pair in pairs)
				{
					if (pair[0] == pair[1])
						continue;

					pair[0] = nums[pair[0]];
					pair[1] = nums[pair[1]];

					int[] array = new int[3] { pair[0], pair[1], nums[i] };
					Array.Sort(array);
					if(!tripletsTuples.Contains((array[0], array[1], array[2])))
						tripletsTuples.Add((array[0], array[1], array[2]));
				}
			}

			foreach(var triple in tripletsTuples)
			{
				triplets.Add(new List<int>() { triple.Item1, triple.Item2, triple.Item3 });
			}

			return triplets;
		}



		public static LinkedList<int[]> TwoSum(int[] nums, int target, int curIndex)
		{
			Dictionary<int, int> map = new Dictionary<int, int>();
			LinkedList<int[]> list = new LinkedList<int[]>();

			for (int i = 0; i < nums.Length; i++)
			{
				if (i == curIndex)
					continue;

				var current = nums[i];
				var x = target - current;
				if (map.ContainsKey(x))
					list.AddLast(new int[] { i, map.GetValueOrDefault(x) });
				if (!map.ContainsKey(current))
					map.Add(current, i);
			}

			return list;
		}

